import React, { useState, useEffect } from 'react';
import { axiosWithAuth } from '../utils/axiosWithAuth.js'

const Friends = props =>{

    const [friends, setFriends] = useState([])

    useEffect(()=>{
        axiosWithAuth()
        .get('/api/friends')
        .then(res => setFriends(res.data))
        .catch(err => console.log({ err }));
    },[])

    console.log(friends)

    return(
        <div>
            <p>Hello</p>
        </div>
    )
}

export default Friends;
